import './index.css';
import App from './App';
import { Route, Router, Routes } from 'react-router-dom';
import React from 'react';
import { createRoot } from 'react-dom/client';

const root = createRoot(document.getElementById('root'));
root.render(
  <Router>
    {' '}
    <App />
  </Router>,
);

